import React, { Component } from 'react';
import Table from 'react-bootstrap/Table';

class RankTable extends Component {
    render() {
        return (
            <>
                <Table>
                    <thead>
                        <th>#</th>
                        <th>#</th>
                        <th>#</th>
                        <th>#</th>
                    </thead>
                    <tbody>
                        <td>#</td>
                        <td>#</td>
                        <td>#</td>
                        <td>#</td>
                    </tbody>

                </Table>
            </>
        )
    }
}

export default RankTable;
